DROP TABLE IF EXISTS uber_requests;
CREATE TABLE uber_requests (
    Request_id INT,
    Pickup_point VARCHAR(50),
    Driver_Id INT,
    Status VARCHAR(50),
    Request_timestamp VARCHAR(20),
    Drop_timestamp VARCHAR(20),
    Request_date DATE,
    Request_time TIME,
    Drop_date DATE,
    Drop_time TIME,
    Request_hour INT,
    Request_day VARCHAR(20),
    Time_slot VARCHAR(20),
    Trip_completed BOOLEAN
);

SELECT Request_hour, COUNT(*) AS total_requests
FROM uber_requests
GROUP BY Request_hour
ORDER BY total_requests DESC;

SELECT Pickup_point, COUNT(*) AS total_requests
FROM uber_requests
GROUP BY Pickup_point
ORDER BY total_requests DESC;


SELECT 
  COUNT(*) AS total_requests,
  SUM(Trip_completed) AS completed_trips,
  COUNT(*) - SUM(Trip_completed) AS failed_trips,
  ROUND(100.0 * SUM(Trip_completed) / COUNT(*), 2) AS completion_rate_percent
  
FROM uber_requests;
SELECT Time_slot, COUNT(*) AS failed_requests
FROM uber_requests
WHERE Trip_completed = 0
GROUP BY Time_slot
ORDER BY failed_requests DESC;

SELECT Status, COUNT(*) AS total_status
FROM uber_requests
GROUP BY Status
ORDER BY total_status DESC;

SELECT Request_date, COUNT(*) AS total_requests
FROM uber_requests
GROUP BY Request_date
ORDER BY Request_date;

SELECT Driver_Id, COUNT(*) AS completed_trips
FROM uber_requests
WHERE Trip_completed = 1
GROUP BY Driver_Id
ORDER BY completed_trips DESC
LIMIT 10;

SELECT Request_hour, COUNT(*) AS requests,
       SUM(CASE WHEN Drop_timestamp IS NULL OR Drop_timestamp = '' THEN 1 ELSE 0 END) AS missing_dropoffs
FROM uber_requests
GROUP BY Request_hour
ORDER BY missing_dropoffs DESC;